		// }
		// await fetchPOST({ username, password }, CREATE_NEW_USER)
		// 	.then((res) => res.json())
		// 	.then(
		// 		(data) => {
		// 			if (data.res) {
		// 				;<Redirect
		// 					to={{
		// 						pathname: '/login',
		// 					}}
		// 				/>
		// 			}
		// 			if (data.err) {
